script: |
  super -f text -I q1434.spq | sort > q1434.out

inputs:
  - name: q1434.spq
    data: |
      SELECT - ( 32 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q1434.out
    data: |
      -32
      -32
      -32
      -32
      -32
      -32
      -32
      -32
      -32
